import ReactDOM from "react-dom";
import { BrowserRouter } from "react-router-dom";
import { Provider } from "react-redux";
import store from "./store/index";
import "./index.css";
import App from "./App";

ReactDOM.render(
  <BrowserRouter>
    <Provider store={store}>
      <App>
      <ReactPlayer
        muted
        autoplay
        controls={false}
        playing={true}
        loop={true}
        width="max-content"
        height="max-content"
        url="https://www.youtube.com/watch?v=aOuVTGG9Bik"
      ></ReactPlayer>
      </App>
    </Provider>
  </BrowserRouter>,
  document.getElementById("root")
);
